'''
FOR LOOP through t 

For each index of t, compare t.count(letter) with s.count(letter)

If they are different, return letter

'''

def findTheDifference(s, t):
    for letter in t:
        if t.count(letter) != s.count(letter):
            return letter
    

a = "abcd"
b = "abcde"

c = ""
d = "y"

e = ""
f = ""



print(findTheDifference(a,b))
print(findTheDifference(c,d))
print(findTheDifference(e,f))
            
